import React from 'react'
import './LoginFooter.css';

function LoginFooter() {
    return (
        <div className='footer'>
            <img src="https://image.shutterstock.com/image-vector/jazz-trumpet-player-vector-illustration-600w-630191957.jpg" alt='Jazz Social' className='footer_logo' />
            <center>
                <p className='footer_button'></p>
            </center>    
        </div>
    )
}

export default LoginFooter
